import React, { useEffect, useState } from "react"
import { ReactDOM } from "react"
import UseFetchExchange from "./useFetchExchange";

export default function TestFetch({ date }) {
    // initializing url
    const domain = 'https://openexchangerates.org/api/historical/';
    const endpoint = '.json?app_id=01341f5261444649a612793df73c7130';
    const url = `${domain}${date}${endpoint}`;
    console.log('url: ' + url);
    console.log('log date: ' + date);
    const data = UseFetchExchange(url);

    console.log('2:' + data);


    useEffect(() => {
        setData(null);

        setData(UseFetchExchange(url));
    }, [date]);


    return (
        <>
            {data &&
                <p>{data.timestamp}</p>
            }
        </>
    )
}
